import React from "react";
import { useState } from "react";
import Msg from "./Components/Msg";
import { useEffect } from "react";
const App = () => {
  const [data, setData] = useState([]);
  const [loading,setLoading]=use
  useEffect(() => {
    fetch("http://localhost:1337/api/students").then((res) => {
      res.json().then((res) => {
        setData(res.data);
      });
    });
  }, []);
  return (
    <div>
      <ul>
        {data.map((item) => (
          <Msg key={item.id} stu={item.attributes} />
        ))}
      </ul>
    </div>
  );
};

export default App;
